"original": |2-
     This REQUIRED attribute indicates the time at which the Job first
     began processing after the Job Creation request or the most recent
     Restart-Job operation.  The out-of-band 'no-value' value is returned
     if the Job has not yet been in the 'processing' state (see the
     beginning of Section 5.1).
"fixed": |-
  This REQUIRED attribute indicates the time at which the Job first began processing after the Job Creation request or the most recent Restart-Job operation.  The out-of-band 'no-value' value is returned if the Job has not yet been in the 'processing' state (see the beginning of Section 5.1).
"ko": |-
  이 필수 속성은 작업 생성 요청 또는 가장 최근의 작업 다시 시작 작업 이후 작업이 처음으로 처리를 시작한 시간을 나타냅니다. Job이 아직 '처리 중' 상태가 아닌 경우 대역 외 '값 없음' 값이 반환됩니다(섹션 5.1의 시작 부분 참조).
